import React from "react";
import { Trans, useTranslation } from 'react-i18next';
import { Translation } from 'react-i18next';

export default function Home() {
  const { t } = useTranslation()
  return (
    <div className="home">
      <h1>Home</h1>
    </div>
  );
}
